import React from "react";
import Slider from "../components/Slider";
import SliderText from "../components/SliderText";
import {
  BannerRight,
  BannerWrap,
  BannerLeft,
  MainText,
  ReasonTitle,
} from "../styles/Reasons";

function Reasons() {
  return (
    <BannerWrap>
      <BannerLeft>
        <ReasonTitle id="about">Мелодром</ReasonTitle>
        <MainText>
          Мелодром је настао из жеље да дугогодишње искуство у раду са децом
          претвори у свима доступну школу клавира и солфеђа.
        </MainText>
        <Slider />
      </BannerLeft>
      <BannerRight>
        <ReasonTitle>Музика</ReasonTitle>

        <SliderText />
      </BannerRight>
    </BannerWrap>
  );
}

export default Reasons;
